import React from 'react';
import './App.css';
import Navbar from './Nav/Navbar';
import { BrowserRouter as Router, Switch, Route} from "react-router-dom";
import Language from './Language';
import PaypalButton from './Payment/PaypalButton';
import PayWithPayPal from './Payment/PayWithPayPal';


class App extends React.Component {
    render(){
        return (
            <Router>
                <div className="app">
                    <Switch>
                        <Route path="/language">
                            <Navbar />
                            <Language />
                        </Route>
                        <Route path="/register">
                            <Navbar />
                            register
                        </Route>
                        <Route path="/aboutus">
                            <Navbar />
                            <PayWithPayPal items={['test']}   />
                        </Route>
                        <Route path="/contact">
                            <Navbar />
                            contact
                        </Route>
                        <Route path="/login">
                            <Navbar />
                            login
                        </Route>
                        <Route path="/">
                            <Navbar />
                            home
                        </Route>
                    </Switch>
                </div>
            </Router>
        );
    }
}

export default App;
